import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './componentes/App';
import Main from './componentes/main/main';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App/>
    <Main/>
  </React.StrictMode>
);
